# Leetcode 3321. Find X-Sum of All K-Long Subarrays II
# https://leetcode.com/problems/find-x-sum-of-all-k-long-subarrays-ii/?envType=daily-question&envId=2025-11-05

# Both TLE k = 6000 x = 2000 length = 10^5 random 
class Solution:
    def findXSum(self, nums: List[int], k: int, x: int) -> List[int]:
        out = []
        piece = nums[0:k-1]
        counted = Counter(piece)
        for i in range(k-1, len(nums)):
            counted[nums[i]] = counted.get(nums[i], 0) + 1
            
            heap = []
            for num, qty in counted.items(): 
                heapq.heappush(heap, (-qty, -num))
            
            total = 0 
            for _ in range(min(x, len(heap))):
                neg_qty, neg_num = heapq.heappop(heap)
                total += neg_qty * neg_num
            out.append(total)
            
            l = nums[i - (k - 1)]
            counted[l] -= 1
            if counted[l] == 0:
                del counted[l] # Critical - maybe most elements in counted will end up 0  
        return out 

class Solution:
    def findXSum(self, nums: List[int], k: int, x: int) -> List[int]:
        out = []
        piece = nums[0:k-1]
        counted = Counter(piece)
        for i in range(k-1, len(nums)):
            counted[nums[i]] = counted.get(nums[i], 0) + 1
            
            top_x = []
            for num, qty in counted.items(): 
                if len(top_x) < x:
                    heapq.heappush(top_x, (qty, num))
                else:
                    item = (qty, num)
                    if item > top_x[0]:
                        heapq.heapreplace(top_x, item)

            total = 0 
            for qty, num in top_x:
                total += qty * num
            out.append(total)

            l = nums[i - (k - 1)]
            counted[l] -= 1
            if counted[l] == 0:
                del counted[l] # Critical - maybe most elements in counted 
        return out
