# Chatgpt solution
from typing import List
import heapq
from collections import defaultdict

class Solution:
    def findXSum(self, nums: List[int], k: int, x: int) -> List[int]:
        n = len(nums)
        if k == 0:
            return []
        if x <= 0:
            return [0] * (n - k + 1)

        # Count of each value in current window
        cnt = defaultdict(int)

        # We keep two heaps with lazy deletion:
        # 1) top_min keeps the CURRENT top-x elements by (freq desc, value desc),
        #    but as a MIN-heap by (freq, value) so the worst among top-x is at the root.
        #    Entries: (freq, value)
        # 2) rest_max keeps everyone else as a MAX-heap by (-freq, -value),
        #    so the best outsider is at the root.
        #    Entries: (-freq, -value)
        top_min = []
        rest_max = []

        # Membership set for which values are currently considered in the "top-x"
        in_top = set()

        # Sum over top-x: sum(freq[v] * v) for v in in_top
        sum_top = 0

        def key_pair(v):
            # sorting key is (freq asc, value asc) for top_min,
            # and (-freq, -value) for rest_max.
            f = cnt.get(v, 0)
            return f, v

        def push_top(v):
            """Put current (freq, v) into top heap and account its contribution."""
            nonlocal sum_top
            if v in in_top:
                # already in top; we push a fresh entry for lazy update and
                # sum_top delta will be handled outside via explicit adjustments
                heapq.heappush(top_min, (cnt[v], v))
            else:
                in_top.add(v)
                heapq.heappush(top_min, (cnt[v], v))
                sum_top += cnt[v] * v

        def push_rest(v):
            """Put current (freq, v) into rest heap."""
            heapq.heappush(rest_max, (-cnt[v], -v))

        def clean_top():
            """Pop stale entries from top_min root until it matches current state and membership."""
            while top_min:
                f, v = top_min[0]
                # stale if freq changed or v is no longer in top
                if v not in in_top or cnt.get(v, 0) != f:
                    heapq.heappop(top_min)
                    continue
                break

        def clean_rest():
            """Pop stale entries from rest_max root until it matches current state and membership."""
            while rest_max:
                nf, nv = rest_max[0]
                f, v = -nf, -nv
                # stale if freq changed or v moved into top or freq==0 (not present)
                if cnt.get(v, 0) != f or v in in_top or f == 0:
                    heapq.heappop(rest_max)
                    continue
                break

        def maybe_promote():
            """Fill top to size x by promoting the best outsiders."""
            nonlocal sum_top
            clean_rest()
            while len(in_top) < x and rest_max:
                nf, nv = heapq.heappop(rest_max)
                f, v = -nf, -nv
                # Validate current
                if cnt.get(v, 0) != f or f == 0 or v in in_top:
                    continue
                in_top.add(v)
                heapq.heappush(top_min, (f, v))
                sum_top += f * v
                clean_rest()

        def rebalance():
            """Ensure the partition is correct: best outsiders outrank worst insider => swap."""
            nonlocal sum_top
            clean_top()
            clean_rest()
            while top_min and rest_max:
                f_in, v_in = top_min[0]       # worst insider (smallest freq/value)
                nf_out, nv_out = rest_max[0]  # best outsider
                f_out, v_out = -nf_out, -nv_out

                # Re-validate current roots
                if v_in not in in_top or cnt.get(v_in, 0) != f_in:
                    heapq.heappop(top_min)
                    clean_top()
                    continue
                if v_out in in_top or cnt.get(v_out, 0) != f_out or f_out == 0:
                    heapq.heappop(rest_max)
                    clean_rest()
                    continue

                # Compare by (freq desc, value desc)  <=>  (freq asc, value asc) reversed
                # If outsider strictly better, swap.
                if (f_out > f_in) or (f_out == f_in and v_out > v_in):
                    # Demote insider
                    heapq.heappop(top_min)
                    in_top.remove(v_in)
                    sum_top -= f_in * v_in
                    # Insider goes to rest (if still present)
                    if cnt.get(v_in, 0) > 0:
                        heapq.heappush(rest_max, (-cnt[v_in], -v_in))

                    # Promote outsider
                    heapq.heappop(rest_max)
                    in_top.add(v_out)
                    heapq.heappush(top_min, (f_out, v_out))
                    sum_top += f_out * v_out

                    # Clean and continue until stable
                    clean_top()
                    clean_rest()
                else:
                    break

        def add_value(v):
            """Include value v into the window (+1 freq) and update structures."""
            nonlocal sum_top
            old = cnt[v]
            cnt[v] = old + 1
            new = cnt[v]

            if v in in_top:
                # Update contribution and push fresh key
                sum_top += (new - old) * v
                heapq.heappush(top_min, (new, v))
            else:
                # push to rest with new key
                heapq.heappush(rest_max, (-new, -v))

            # Make room if top missing elements, then rebalance order
            maybe_promote()
            rebalance()

        def remove_value(v):
            """Remove one occurrence of v from the window (-1 freq) and update structures."""
            nonlocal sum_top
            old = cnt[v]
            new = old - 1
            if old == 0:
                return  # shouldn't happen

            if v in in_top:
                # Adjust contribution
                sum_top += (new - old) * v  # subtract v
                # If it drops to 0, it leaves entirely
                if new == 0:
                    in_top.remove(v)
                    # No need to push into rest; it's gone
                else:
                    # Still in top for the moment; push updated key
                    heapq.heappush(top_min, (new, v))
            else:
                # Update rest key if it remains present
                if new > 0:
                    heapq.heappush(rest_max, (-new, -v))

            # Write back / delete zero
            if new == 0:
                del cnt[v]
            else:
                cnt[v] = new

            # If we lost someone from top, try to fill from rest; then rebalance.
            maybe_promote()
            rebalance()

        out = []

        # Build the first window
        for i in range(k):
            add_value(nums[i])
        out.append(sum_top)

        # Slide
        for i in range(k, n):
            add_value(nums[i])
            remove_value(nums[i - k])
            out.append(sum_top)

        return out

